  yOffset: 0,
  xOffset: 0,
  transform: ''
};
export const KickstarterIcon = props => {
  const newProps = Object.assign({
    config: KickstarterIconConfig
  }, props);
  return React.createElement(SVGIcon, newProps);
};
export default KickstarterIcon;
